create table user_redemption_points
(
    id              int unsigned auto_increment
        primary key,
    user_id         int unsigned                       not null comment '用户ID',
    total_point     int unsigned                       not null comment '累计复购积分点数',
    used_point      int unsigned                       not null comment '累计已使用的复购积分点数',
    remaining_point int unsigned                       not null comment '剩余可使用的复购积分点数',
    created_at      datetime default CURRENT_TIMESTAMP not null,
    updated_at      datetime                           null,
    deleted_at      datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index user_redemption_points_user_id_index
    on user_redemption_points (user_id);

